import React from 'react';
import logo from './logo.svg';
import './App.css';
import UserGreeting from './components/UserGreetingIfElse';
import HelloHelloCreateElement from './components/HelloCreateElement';
import HelloCreateElementByReturn from './components/HelloCreateElementByReturn';
import GreetFunction from './components/GreetFunction';
import GreetDestructureProps from './components/GreetDestructureProps';
import GreetProps from './components/GreetProps';
import GreetConst from './components/GreetConst';
import WelcomeClass from './components/WelcomeClass';
import WelcomeClassDestructureProps from './components/WelcomeClassDestructureProps';
import WelcomeClassProps from './components/WelcomeClassProps';
import MessageClass from './components/MessageClass';
import CounterClass from './components/CounterClass';
import CounterClassPrevState from './components/CounterClassPrevState';
import FunctionClick from './components/FunctionClick';
import ClassClick from './components/ClassClick';
import EventBindClass from './components/EventBindClass';
import EventBindClassArrowFunction from './components/EventBindClassArrowFunction';
import EventBindClassConstructor from './components/EventBindClassConstructor';
import EventBindClassArrowFunctionInClass from './components/EventBindClassArrowFunctionInClass';
import ParentComponent from './components/ParentComponent';


function App() {
  return (
    <div className="App">
      <UserGreetingIfElse></UserGreetingIfElse>
      <ParentComponent></ParentComponent>
      <EventBindClassArrowFunctionInClass></EventBindClassArrowFunctionInClass>
      <EventBindClassConstructor></EventBindClassConstructor>
      <EventBindClassArrowFunction></EventBindClassArrowFunction>
      <EventBindClass></EventBindClass>
      <ClassClick></ClassClick>
      <FunctionClick></FunctionClick>
      <CounterClassPrevState></CounterClassPrevState>
      <CounterClass></CounterClass>
      <MessageClass></MessageClass>
      <GreetFunction />
      <GreetConst />
      <WelcomeClass />
      <HelloCreateElementByReturn></HelloCreateElementByReturn>
      <HelloHelloCreateElement></HelloHelloCreateElement>
      <GreetDestructureProps name="Ram" heroName="God Ram" />
      <p>This is children props.</p>
      <button>Action</button>
      <GreetProps name="Ram" heroName='God Ram' />
      <p>This is children props.</p>
      <GreetProps name="Lakhan" heroName="Ram's second brother" />
      <button>Action</button>
      <GreetProps name="Bharat" heroName="Ram's third brother" />
      <WelcomeClassDestructureProps name="Ram" heroName='God Ram'></WelcomeClassDestructureProps>
      <WelcomeClassProps name="Ram" heroName='God Ram'></WelcomeClassProps>
      <WelcomeClassProps name="Lakhan" heroName="Ram's second brother"></WelcomeClassProps>
    </div>
  );
}

export default App;
